
DROP TABLE IF EXISTS salary_50000;
DROP TABLE IF EXISTS employees_50000;

CREATE TABLE employees_50000 (
  id SERIAL PRIMARY KEY,
  employeeName VARCHAR(50) NOT NULL,
  emailAddress VARCHAR(255) NOT NULL UNIQUE,
  employeeId VARCHAR(6) NOT NULL UNIQUE
);

CREATE INDEX idx_employeeId ON employees_50000 (employeeId);

CREATE TABLE salary_50000 (
  id SERIAL PRIMARY KEY,
  employeeId VARCHAR(6) NOT NULL,
  salary INT CHECK (salary BETWEEN 10000 AND 90000),
  experiencedYear INT CHECK (experiencedYear BETWEEN 1 AND 10),
  FOREIGN KEY (employeeId) REFERENCES employees_50000(employeeId) ON DELETE CASCADE
);

CREATE INDEX idx_employeeId_salary ON salary_50000 (employeeId);



